INSERT INTO `wp_posts` VALUES (47,1,'2020-09-05 09:17:57','2020-09-05 09:17:57','<h1>7th SKY Production            </h1>		\n			<h1>CREATIVITY at it\'s PEAK</h1>		\n			<a href=\"/Portfolio/\" role=\"button\">\n						PORTFOLIO\n					</a>\n			<a href=\"/About%20us/\" role=\"button\">\n						Contact\n					</a>\n				<a href=\"//videography\">\n								</a>\n				<h3>\n					<a href=\"//videography\">Videography</a>\n				</h3>\n								<p>Responsible for editing and assembling recorded raw material into a suitable, finished product ready for broadcasting. The material may include camera footage, dialogue, sound effects, graphics and special effects.</p>\n				<a href=\"//photography\">\n								</a>\n				<h3>\n					<a href=\"//photography\">Photography</a>\n				</h3>\n								<p>Review and select photos for promotion, publication, and dissemination. They identify relevant images, edit photos to make them more appealing, and arrange them in a suitable layout.</p>\n				<a href=\"//web%20design\">\n								</a>\n				<h3>\n					<a href=\"//web%20design\">Web Design</a>\n				</h3>\n								<p>Responsible for both back-end and front-end development, including creating WordPress themes and plugins. They have different programming skills such as namely PHP, HTML5, CSS3.</p>\n			<h2><a href=\"/about%20us/\">Who we are? What we Do?</a></h2>		\n		<strong><em>It is a production house which edit videos and create a special designs for your videos and and much more, here you will get amazing graphics work.</em></strong>		\n			<a href=\"#\" role=\"button\">\n						More About US\n					</a>','Home','','publish','closed','closed','','home','','','2020-11-16 16:32:20','2020-11-16 16:32:20','',0,'http://mtech.local/?page_id=47',0,'page','',0);
